import React from 'react';
import NewsSlider from '../../../Widgets/NewsSlider/slider';
import NewsList from '../../../Widgets/NewsList/newsList';

const NewsMain = () => (

    <div>
        <NewsSlider
            type="featured"
            settings={{ dots: false }}
            start={0}
            amount={3}
        />
        <NewsList
            type="card"
            loadMore={true}
            
            />
    </div>
)

export default NewsMain;
